import React, { useEffect, useState } from 'react'

import { ListData } from "../asset/components/RanderList/ListData";
import axios from 'axios';
import { fetchDataMovieDetail, useMovieDataQueryDetail } from '../services/movie/get-data-movie-detail';
import { Carousel } from "@material-tailwind/react";

export const DetailPage = () => {

const [movies, setMovies] = useState([]);
const [PageNow, setPageNow] = useState(1);
//  const bg_image = {
//    background-image: url('background.jpg');
//   };

//level 4 (lebih dinamais menmapung banyak parameter dengan sederhana)
const{data:fetchUser} = useMovieDataQueryDetail({
  id : PageNow
})

const getDataMovie = async () => {
  const data = await fetchDataMovieDetail(PageNow)
  setMovies(data.results) 
  // console.log(movies, "data movie");
} 

//untuk melakukan tindakan saat pertama dijalankan atau di mounting
useEffect(()=>{
  getDataMovie()
  console.log(fetchUser, "ini datanya")
}, [fetchUser])


  return (
    <div>
      <div className='font-sans'>
        <div className=" min-h-screen bg-transparent h-screen">
          <div className='relative z-40 p-4'>
            <div className='flex justify-between bg-slate-950'>
              <div>
                <h1 className='text-red-500 font-bold text-4xl'>MovieList</h1>
              </div>
              <div>
                <input type="text" className="bg-transparent border-2 border-red-500 w-[30rem] h-[2.5rem] py-2 px-3 rounded-full focus:outline-none" placeholder="Search for movies..."/>
              </div>
              <div className='gap-3'>
                <button class="text-red-500 w-[6rem] h-[2.5rem] mr-4 w-5 rounded-full border-2 border-red-500 font-semibold bg-transparent">Login</button>
                <button class="text-white w-[6rem] h-[2.5rem] rounded-full font-semibold bg-red-500">Register</button>
              </div>
            </div>
          </div>
          
          
            <div alt="image 1"className="h-full p-4 w-full object-cover bg-[url('https://images.unsplash.com/photo-1493246507139-91e8fad9978e?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2940&q=80')]"  >
              
              <div className='flex self-center gap-4 mt-[12rem] ms-10 flex-col w-[50%]'>
                <h1 className='text-6xl text-white font-bold'>Judul Movie</h1>
                <p className='text-white'>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Vero, facilis! Sint, mollitia dolores neque quaerat aperiam ad numquam culpa eveniet reprehenderit hic, ipsum obcaecati. Ducimus maiores impedit ullam consequatur beatae.</p>
                <button className="text-white w-[8rem] h-[2.5rem] rounded-full font-semibold bg-red-500">Watch NOW</button>
              </div>
            </div>

        </div>

        <div className='p-4'>
          <div className='flex justify-between h-[2.5rem] m-0 p-0'>
            <div>
              <h1 className='text-3xl font-medium'>Popular Movie</h1>
            </div>
            <div className='flex place-items-center'>
              <h3 className='text-red-600'>see all movie</h3>
            </div>
          </div>


          <div className="mx-auto mt-10 px-4">
            <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-5 ">
              {console.log(movies, "data movie")}
              {movies.map(movie => (
                <ListData key={movie.id} title={movie.title} releaseDate={movie.release_date}posterPath={movie.poster_path} />
              ))}
                
            </div>
                {/* <h1 className='text-3xl'>{movies.title}</h1> */}
            <div className='flex justify-between mt-8'>
              
              <button onClick={()=>{
                setPageNow(PageNow - 1)
              }}>Back Page</button>

              <h1>{PageNow}</h1>

              <button onClick={()=>{
                setPageNow(PageNow + 1)
              }}>Next Page</button>
            </div>

          </div>

          

        </div>

        
        
      </div>
     
    </div>
  )
}
